import React from "react";
import MatchDetailButton from "../../components/matchDetail/matchDetailButton";
import {Button} from "@headlessui/react/dist/components/button/button";


export default function TeamControlPanel(setType) {
    return(
        <div className={"mt-3 py-3 mb-3"} style={styleContainer}>
            <div className={"flex flex-row gap-8 lg:px-20"}>
                <Button id={"results"} text={"Výsledky"}></Button>
                <Button id={"program"} text={"Program"}></Button>
                <Button id={"lineUp"} text={"Soupiska"}></Button>
            </div>
        </div>
    );
}

const styleContainer = {
    backgroundColor: "#241F55",
    fontWeight: "bold",
    textTransform: "uppercase",
    borderBottomRightRadius: "20px",
    borderBottomLeftRadius: "20px"
}
